import React, { Component } from 'react'

class Items extends Component {
    render() {
        return (
            <div className='item d-flex gap-2 justify-content-between align-items-center'>
                <div className='img position-relative'>
                    <img src={this.props.img} alt="strem-item" className='rounde-5' />
                </div>
            </div>
        )
    }
}

export default Items;
